import { INCREMENT,DECREMENT} from './tipe'

const INITIAL_STATE = {
    count : 0
};

export function counterReducer(state= INITIAL_STATE, action) {
    switch (action.type) {
        case INCREMENT:
            return {...state,count:action.data + 1}
          
        case DECREMENT:
            return {...state,counter:action.data - 1}
          
        default:
            return state;
          
    }
}
